import { createApp } from 'vue'
import App from './App.vue'
// thực hiện phân trang
import "vue-pagination-tw/styles";
import VuePaginationTw from "vue-pagination-tw";

const app = createApp({})
    // import { createRouter, createWebHistory } from 'vue-router'
    // import EmployeeList from './components/page/EmployeeList.vue'
import router from './js/router'
// import HomeList from './components/page/HomeList.vue'
import axios from 'axios'
import VueAxios from 'vue-axios'


app.component('DialogNotice')
    //thực hiện phân trang
app.component("VuePaginationTw", VuePaginationTw);
createApp(App).use(router, VueAxios, axios).mount('#app')
